import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

export function StateDetail() {
  const { id } = useParams();
  const [casa, setCasa] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:3001/verInmueble/${id}`)
      .then(response => {
        if (!response.ok) {
          throw new Error('Error al obtener detalles del inmueble');
        }
        return response.json();
      })
      .then(response => {
        setCasa(response);
        console.log(response);
      })
      .catch(error => {
        console.error('Error:', error);
        setCasa(null); // Puedes establecer casa en null o manejarlo de otra manera según tus necesidades
      });
  }, [id]);
  

  

  return (
    <div>
      <h2>Detalles del Inmueble</h2>
      {casa ? (
        <>
          <p>ID: {casa.idInmueble}</p>
          {/* Otras propiedades del inmueble */}
        </>
      ) : (
        <p>Cargando detalles del inmueble...</p>
      )}
    </div>
  );
  
}
